INSERT INTO `page_datas` (`id`, `title`, `thumbnail`, `description`, `service_type`, `page_type`, `created_at`, `updated_at`) VALUES
	(1, 'Overview', '0', '<p><img src="data:image/png;base64," data-filename="Untitled.png" style="width: 100%;"></p><p style=""><font face="Arial">SS Group is also commonly known as S.S Group of Companies is a blending of various corporate houses. Having its corporate office at House #55 (Ground Floor), Road # 05, Mohammadia Housing Society, Mohammadpur, Dhaka-1207, Bangladesh. Actually, we represent ourselves as S.S Group of companies, one of the foremost business houses having heterogeneous business sectors in Development Work, Construction Work, Construction Materials Supply, Trading of Leather Goods, Trading of Imported Chemicals and Pigments, Supply of various Imported &amp; Local Gift Items, Interior Decoration Item Supply, General Trading and Export &amp; Imports etc. Presently, our group of companies encompasses total six entities and more are coming.</font></p><p><font face="Arial">But, initially S.S Group of Companies started its journey with S.S Enterprise of Mr. Md. Abu Sadeq in 2005. From the very begging firm is engaged with trading and supplier/souring agent of various gift items, stationary items, sports item along with this trading businesses, firm was also engaged with on demand suppliers of various imported&amp; local items and various types of construction materials supply.&nbsp; The Business has created a hefty number of loyal customers over the last several years. Consequently, today S.S Enterprise induce to become a Group of Companies namely S.S Group Companies.&nbsp;&nbsp;</font></p><p><font face="Arial">Business Units of S.S Group of Companies:&nbsp;</font></p><p style="margin-left: 25px;"><font face="Arial">a.<span style="white-space: pre;">	</span>First S.S Enterprise (Pvt.) Limited</font></p><p style="margin-left: 25px;"><font face="Arial">b.<span style="white-space: pre;">	</span>S.S Enterprise&nbsp;</font></p><p style="margin-left: 25px;"><font face="Arial">c.<span style="white-space: pre;">	</span>Nawshin Enterprise</font></p><p style="margin-left: 25px;"><font face="Arial">d.<span style="white-space: pre;">	</span>Anika Trading Corporation&nbsp;</font></p><p style="margin-left: 25px;"><font face="Arial">e.<span style="white-space: pre;">	</span>Gift &amp; Premium&nbsp;&nbsp;</font></p><p style="margin-left: 25px;"><font face="Arial">f.<span style="white-space: pre;">	</span>Nawshin Wall Coating</font></p>', '0', '1', '2018-11-12 19:33:47', '2018-11-16 13:23:44'),
	(2, 'Vision & Mission', '0', '<p><img src="data:image/png;base64," data-filename="Untitled.png" style="width: 100%;"></p><p><b>Vision</b></p><p>To be one of the most respected business organizations in South East Asia.&nbsp;</p><p><b>Mission</b></p><p>To pursue excellence in manufacturing, agriculture and tourism for the benefit of our clients, the community and environment.</p><p><b>Objective</b></p><p>To be one of Bangladeshs leading institutions in the building and construction industry, distributing affordable high quality products for both local and international consumption.</p><p><b>Values</b></p><p>S.S Groups primary focus is on the business sector and this has enabled it to make great inroads in industrial production in Bangladesh.</p><p>We wish to congratulate our staff for the hard work and team spirit which has made it possible to achieve our present status, and continued to boost our companies into the new millennium, to meet the new challenges such as regional markets, as well as the competitive forces that came along with it.&nbsp;</p><p>Our focus will be to excel in the fields we are in, by paying particular attention to the minute detail, keeping in mind the bigger picture.</p><p>Our values will be to fulfill all our commitments regardless of the consequences. We thrive on challenging opportunities, and continue to inject new capital towards technology. Our purpose is to grow consistently and meet all of our customer\'s needs.</p><div><br></div>', '0', '1', '2018-11-12 19:47:32', '2018-11-16 13:26:02');
INSERT INTO `page_datas` (`id`, `title`, `thumbnail`, `description`, `service_type`, `page_type`, `created_at`, `updated_at`) VALUES
	(3, 'Management', '0', '<p><img src="data:image/png;base64," data-filename="Untitled.png" style="width: 100%;"></p><p class="MsoNormal" style="text-align:justify"><span style="font-size: 12pt; line-height: 107%; font-family: Garamond, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">A team of experienced and\r\nhighly skilled professionals having good corporate culture runs S.S Group. The\r\ndynamic leadership of an enthusiastic, proactive and visionary Board of\r\nDirectors guides them. They all together are relentlessly working for the growth\r\nand development of the group.</span></p>', '0', '1', '2018-11-12 19:48:30', '2018-11-24 09:03:28'),
	(17, 'Operations & Maintenance', '0', '<h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;"><font color="#003163">Overview</font></h3><h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;"><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif; font-weight: 400; letter-spacing: normal;">AL-AMEED Operations &amp; Maintenance represents the starting point of the AL-AMEED Holding empire. Opening for business almost 40 years ago, the company has done nothing but expand since.</p><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif; font-weight: 400; letter-spacing: normal;">Today, AL-AMEED O&amp;M is the largest company in Saudi Arabia in the field of Operations and Maintenance services. We provide full operational guidance and maintenance services (mechanical, electrical, contracting, etc.) across all industries. AL-AMEED O&amp;M headcount exceeds 22,000 employees kingdom wide.</p></h3><h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;"><font color="#003163">Services</font></h3><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">AL-AMEEDOperations &amp; Maintenance serves as a model for the entirety of AL-AMEED Holding. The broad spectrum of O&amp;M services it offers are an ideal example of the level of service that all AL-AMEED customers have come to expect. Our diverse service line gives us the luxury of reaching all types of client needs. And thats just what we strive to do: fulfill the unique needs of every single client in an efficient manner that makes life easier for them.</p><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">The AL-AMEED Operations &amp; Maintenance service line includes the following:</p><ul class="CompaniesOM" style="margin-right: 10px; margin-left: 0px; padding: 0px 0px 0px 15px; border: 0px; font-size: 14px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">General Contracting</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Electrical works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Mechanical works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Cleaning works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Water and sanitation works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Operations and Maintenance of Air Navigation Systems</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Operations and Maintenance of Sea Ports</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Full operation of comprehensive medical facilities</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Provision of full operational guidance and maintenance services (mechanical, electrical, contracting, etc.) for industrial-sized facilities, including:<ul class="CompaniesOM" style="margin-right: 0px; margin-left: 0px; padding: 0px 0px 0px 15px; border: 0px; vertical-align: baseline; list-style: disc;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Public buildings &amp; facilities</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Military buildings &amp; facilities</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">University buildings &amp; facilities</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Airports</li></ul></li></ul>', 'Operation & Maintenance', '3', '2018-11-24 08:43:55', '2018-11-24 08:43:55'),
	(18, 'Construction Worker', '0', '<p><font color="#003163"><b>Overview</b></font></p><p>The AL-AMEED Holding portfolio would be incomplete without real estate investment arm, and AL-AMEED Real Estate Investment &amp; Development is proud to do just that. We have over 3 decades of experience in the Middle East and have experienced the highs and lows of the marketplace. We were among the first real estate investment companies in Saudi Arabia to fall in compliance with Saudi Ministry of Commerce regulations and have continued to run our business with the utmost integrity since then.</p><p><br></p><p>AL-AMEED Real Estate &amp; development business activities span across the Arab World, Europe and North America.</p><p><br></p><p><b><font color="#003163">Services</font></b></p><p>Our services are strictly real estate investment and development-based, and serve the interests of both AL-AMEED Holdings shareholders and our clients such as:</p><p><br></p><p>Real estate investment.</p><p>Development of joint real estate projects.</p><p>Development of regional real estate projects.</p><p><b><font color="#003163">Projects</font></b></p><p>Lamar Towers  Jeddah</p><p>Zahran Business Center (ZBC)  Jeddah</p><p>Infinity Tower  Dubai (sold in 2012)</p><p>Onyx Project  Dubai</p><p>Seasons Project  Dubai</p>', 'Construction Worker', '3', '2018-11-24 08:50:06', '2018-11-24 08:51:14'),
	(19, 'Cleaning Worker', '0', '<h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(122, 192, 67); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Overview</h3><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">Al-Mashriq Medical was founded in 1990 as Zahran group of companies medical subsidiary. We operate with a strict vision of providing operations and management services for medical facilities. Our networks cover a wide territory throughout the Saudi Arabian market and beyond. We are also proud to serve as an authorized representative for a number of international medical technology brands.</p><div style="margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;"><h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(122, 192, 67); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Services</h3><p style="margin-top: 10px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify;">Al-Mashriq Medical focus is strict and narrow, allowing us to perfect the end results that our clients desire. The services we provide are:</p><p style="margin-top: 10px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify;">Management and operation of hospitals, including:</p><ul class="CompaniesOM" style="margin-right: 10px; margin-left: 0px; padding: 0px 0px 0px 15px; border: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Medical equipment maintenance</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Medical facilities equipping</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Testing and calibration services</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Technical support</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Training and education services</li></ul><br style="margin: 0px; padding: 0px;"><p style="margin-top: 10px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify;">Distribution of retail medical products, including:</p><ul class="CompaniesOM" style="margin-right: 10px; margin-left: 0px; padding: 0px 0px 0px 15px; border: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Diagnostic ultrasound</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Surgical equipment</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Educational devices</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Medical accessories and spare parts</li></ul></div>', 'Cleaning Worker', '3', '2018-11-24 08:55:04', '2018-11-24 08:55:04'),
	(20, 'IT & Security Solution', '0', '<h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(0, 106, 52); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Overview</h3><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">Technical Development Company (TDC) provides combined services for Mechanical and Electrical works from one single source.</p><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">Technical Development business planning starts by hiring highly qualified staff.</p><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">TDC empowers its work force with the right means and tools to establish a strategic framework for success in performing Electro Mechanical works for our customers, including both government and private sector in KSA. This will enable TD to challenge the high market competition and achieve its objectives.</p><div style="margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;"><h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(0, 106, 52); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Services</h3><p style="margin-top: 10px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify;">These services basically are:</p><ul class="CompaniesOM" style="margin-right: 10px; margin-left: 0px; padding: 0px 0px 0px 15px; border: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Power generators (Prime  Standby)</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Medium / Low Voltage System</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">HVAC System</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Fire Fighting &amp; Protection System</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Aircraft Ground Support System</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Energy and Building Management System (BMS)</li></ul></div>', 'IT & Security Solution', '3', '2018-11-24 08:55:40', '2018-11-24 08:55:40'),
	(21, 'Industrial Workers', '0', '<h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(239, 64, 35); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Overview</h3><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">From the moment you break ground on your construction project, you will always find Al-Joudah Construction &amp; Contracting standing by your side. Serving as a leading construction company in Saudi Arabia since 1995, we have amassed a basket of projects worth over 20 Billion Saudi Riyals. We focus on the large-scale, executing our construction, engineering, and development services for hospitals, universities, high-rise towers, and municipal roads projects. We are experts in every facet of the development and construction process.</p><div style="margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;"><h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(239, 64, 35); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Services</h3><p style="margin-top: 10px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify;">Teaming with only the most talented and capable workforce, we are able to suit all of your construction and development needs. Our services include:</p><ul class="CompaniesOM" style="margin-right: 10px; margin-left: 0px; padding: 0px 0px 0px 15px; border: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Civil works  Roads and Bridges</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Electrical works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Mechanical works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Heavy Foundations</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Buildings</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Airports</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Defense Facilities</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Structural Steel works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Pre-cast Erection works</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Water and Sewage Networks</li><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;">Pre-engineered Structures and Hangers</li></ul></div>', 'Industrial Workers', '3', '2018-11-24 08:56:13', '2018-11-24 08:56:13'),
	(22, 'Manpower Supply', '0', '<p><br></p><h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(179, 28, 31); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Overview</h3><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">Al-AMEED Security is the leading security solutions and specialized escort protection provider in Saudi Arabia. We envision the geographic expansion of our successful business model, and will continue providing the highest level of professional security and loss prevention in the industry.</p><p style="margin-top: 10px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;">Our specialties include basic security solutions and escort protection for Saudi Arabias private industry and governmental officials. We take pride in individually customizing our services based on the unique needs of our clients, and we will treat you like VIP every step of the way. At Al-AMEED&nbsp;Security, we are proud to offer yet another diverse service under the umbrella of AMEED&nbsp;Holding.</p><div style="margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; color: rgb(109, 110, 113); font-family: Arial, Helvetica, sans-serif;"><h3 class="service-title" style="margin: 25px 0px 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; font-weight: 700; overflow-wrap: break-word; font-family: Poppins-Regular; color: rgb(179, 28, 31); letter-spacing: 0.5px; text-shadow: rgba(0, 0, 0, 0.2) 1px 1px 3px;">Services</h3><p style="margin-top: 10px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; text-align: justify;">We offer the latest security solutions and escort protection for all confidential and specialized governmental and private institutions. We are willing and able to add, subtract, or alter our base services depending on specific needs and demands. Our excellence in the field is reflected in how we structure and offer security solutions to our extensive group of clientele.</p></div>', 'Manpower Supply', '3', '2018-11-24 08:57:30', '2018-11-24 08:57:30'),
	(23, 'Saudi Arabian General Investment Authority (SAGIA)', '1543050994.jpg', '<p><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;">The Saudi Arabian General Investment Authority is the foreign investment license provider for the Kingdom. It was created by the Saudi Government on 10 April 2000, as part of measures geared towards formalizing the process of economic liberalization</span><br></p>', '0', '2', '2018-11-24 09:16:34', '2018-11-24 09:16:34'),
	(25, 'Saudi Telecom Company', '1543051176.jpg', '<p><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;">Saudi Telecom Company, is a Saudi Arabia-based telecommunications company that offers landline, mobile, Internet services and computer networks. The company lost its monopoly on mobile phone services after the assignment of a second license to Etihad Etisalat</span><br></p>', '0', '2', '2018-11-24 09:19:36', '2018-11-24 09:19:36');
